import 'bootstrap/dist/css/bootstrap.min.css';
import {Navbar as BTNavBar, Nav, Container} from 'react-bootstrap';
import logo from '../logo-nuevo-png';
import './navbar.css';

const NavBar = () => {
  return <>
    <BTNavBar bg="light" expand="lg">
        <Container fluid>
            <BTNavBar.Brand href="#">
                <img src={logo} width="40px" height="40px" className="" alt="Heladoss" />
            </BTNavBar.Brand>
            <BTNavBar.Toggle aria-controls="navbarScroll" />
            <BTNavBar.Collapse id="navbarScroll">
            <Nav
                className="ml-auto my-2 my-lg-0"
                style={{ maxHeight: '100px' }}
                navbarScroll
            >
                <Nav.Link href="#action1">Inicio</Nav.Link>
                <Nav.Link href="#action2">Productos</Nav.Link>
                <Nav.Link href="#action3">Contacto</Nav.Link>
            </Nav>
            </BTNavBar.Collapse>
        </Container>
    </BTNavBar>
  </>;
};

export default NavBar;
